import React from "react";
import { useNavigate } from "react-router-dom";

export default function PageHeaderHeader({ user, onLogout, onToggleProfile }) {
  const navigate = useNavigate();

  return (
    <nav className="navbar navbar-expand-lg navbar-light bg-white shadow-sm mb-4 rounded-3 px-3">
      <a className="navbar-brand fw-bold" href="/" style={{ color: "#ff7a29" }}>
        ðŸŒ¸ MyApp
      </a>

      <div className="ms-auto d-flex align-items-center gap-3">
        <span
          className="fw-semibold"
          style={{ cursor: "pointer" }}
          onClick={onToggleProfile}
        >
          {user.fullName}
        </span>

        <img
          src={user.avatar}
          alt="avatar"
          onClick={onToggleProfile}
          className="rounded-circle border border-2"
          style={{
            width: "40px",
            height: "40px",
            objectFit: "cover",
            cursor: "pointer",
          }}
        />

        <button
          className="btn btn-outline-danger btn-sm rounded-pill"
          onClick={onLogout}
        >
          Logout
        </button>
      </div>
    </nav>
  );
}
